import React from 'reactstrap';
import { Input } from 'reactstrap';
import consulta from '../ConsultaProdu/consulta.css';
const Consulta = (props) => {
  return (
    <div className="CorpoProdutoCad">
      <Input type='checkbox'>Revista</Input>
      <Input type='checkbox'>Coleção</Input>

      <InputLabel >Revista</InputLabel>
      <Select
        label="Revista"
      >
        <MenuItem value=""></MenuItem>
      </Select>
    </div>
  );
};

export default Consulta;
